import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Form.css';


export default function ToggleLicenseForm() {
  const [form, setForm] = useState({ personID: '', license: '' });
  const [message, setMessage] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      await axios.post('/api/pilot_licenses/toggle', form);
      setMessage('✅ License status toggled');
      setError(null);
    } catch (e) {
      setError(e.response?.data?.error || e.message);
      setMessage(null);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4 p-4 bg-white rounded shadow">
      <div>
        <label className="block font-medium">Person ID</label>
        <input
          type="text" required
          className="w-full p-2 border"
          value={form.personID}
          onChange={e => setForm(f => ({ ...f, personID: e.target.value }))}
        />
      </div>
      <div>
        <label className="block font-medium">License</label>
        <input
          type="text" required
          className="w-full p-2 border"
          value={form.license}
          onChange={e => setForm(f => ({ ...f, license: e.target.value }))}
        />
      </div>
      <button type="submit" className="px-4 py-2 bg-indigo-600 text-white rounded">
        Toggle License
      </button>
      {message && <p className="text-green-600 mt-2">{message}</p>}
      {error && <p className="text-red-600 mt-2">{error}</p>}
    </form>
  );
}
